INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 10011, "2019/01/31 12:00:00", 0, -385.0, 1, "エリコ（バレンタイン）", 4.08, 2, 8.0, "2030/12/17 14:59:59", 1, 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 10011, "2019/01/31 12:00:00", 0, -385.0, 1, "エリコ（バレンタイン）", 5.0, 2, 8.0, "2030/12/17 14:59:59", 2, 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 10011, "2019/01/31 12:00:00", 0, -385.0, 1, "エリコ（バレンタイン）", 10.11, 2, 8.0, "2030/12/17 14:59:59", 3, 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 10011, "2019/01/31 12:00:00", 0, -385.0, 1, "エリコ（バレンタイン）", 4.0, 2, 8.0, "2030/12/17 14:59:59", 4, 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109001, 10011, "2019/01/31 12:00:00", 0, -385.0, 1, "エリコ（バレンタイン）", 6.0, 2, 8.0, "2030/12/17 14:59:59", 5, 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 10011, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 0.0, 1, 0.0, "2030/12/17 14:59:59", 6, 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 10011, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 0.0, 1, 0.0, "2030/12/17 14:59:59", 7, 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 10011, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 0.0, 1, 0.0, "2030/12/17 14:59:59", 8, 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 10011, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 0.0, 1, 0.0, "2030/12/17 14:59:59", 9, 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109002, 10011, "2019/01/31 12:00:00", 0, 0.0, 1, "エリコ（バレンタイン）", 0.0, 1, 0.0, "2030/12/17 14:59:59", 10, 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 10011, "2019/01/31 12:00:00", 0, -385.0, 1, "シズル（バレンタイン）", 2.12, 2, 8.0, "2030/12/17 14:59:59", 1, 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24);
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (109101, 10011, "2019/01/31 12:00:00", 0, -385.0, 5, "シズル（バレンタイン）", 4.19, 2, 8.0, "2030/12/17 14:59:59", 2, 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24);
